import React from 'react';
import '../Profile/Profile.css';

const UserComponent = (props) => {
    return (
        <div className={'user-box'}>
            <div className={'user-box-avatar'}>
                <img src={props.user.avatarSrc} className={'avatar'}/>
            </div>

            <div className={'user-box-information'}>
                <div className="user-name">
                    {props.user.firstName} {props.user.secondName}
                </div>
                <div>
                    День рождения: {props.user.birthday}
                </div>
                <div>
                    Город: {props.user.city}
                </div>
                <div>
                    Образование: {props.user.education}
                </div>
                <div>
                    Веб-сайт: {props.user.site}
                </div>
            </div>
        </div>
    );
}

export default UserComponent;
